INSERT INTO `hhs_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `is_shipping`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `share_bonus_type`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `team_num`, `team_price`, `little_img`, `sales_num`, `is_mall`, `is_team`, `is_nearby` ) VALUES  ('71', '1', 'HHS000071', '【测试商品-网站演示专用】先歇歇  芒果', '+', '51', '0', '', '987', '0.040', '36.00', '30.00', '0.00', '0', '0', '1', '', '卵圆形，果肉呈黄色，外层果肉甜，接近果核部分稍酸，风味独特。该品种具有纤维少，味甜芳香，营养丰富的优良品质，集热带水果精华于一身，素有热带果王的美誉。', '<p style=\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;font-style:normal;font-weight:normal;text-align:start;text-indent:0px;background-color:#FFFFFF;\">\r\n	<strong>温馨提示：</strong> \r\n</p>\r\n<p style=\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;font-style:normal;font-weight:normal;text-align:start;text-indent:0px;background-color:#FFFFFF;\">\r\n	为了避免芒果运输途中损坏，我们都是采摘9成熟的发出的，您收到果果后一定要催熟后才能食用哦！\r\n</p>\r\n<p style=\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;font-style:normal;font-weight:normal;text-align:start;text-indent:0px;background-color:#FFFFFF;\">\r\n	<strong>催熟方法：</strong> \r\n</p>\r\n<p style=\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;font-style:normal;font-weight:normal;text-align:start;text-indent:0px;background-color:#FFFFFF;\">\r\n	收到果果后把熟软的芒果挑出来，然后把生的原箱密封好，放在温度高点的地方2-5天可熟（每天都检查一下哦！）\r\n</p>\r\n<p style=\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;font-style:normal;font-weight:normal;text-align:start;text-indent:0px;background-color:#FFFFFF;\">\r\n	<strong>禁忌：</strong> \r\n</p>\r\n<p style=\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;font-style:normal;font-weight:normal;text-align:start;text-indent:0px;background-color:#FFFFFF;\">\r\n	由于芒果为热带后熟水果，没有催熟的芒果一定不能放冰箱。熟软后建议立即食用（可放冰箱暂存）\r\n</p>\r\n<img src=\"https://img.alicdn.com/imgextra/i4/2219843891/TB2_4_aepXXXXXRXXXXXXXXXXXX-2219843891.jpg\" style=\"border:0px;\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i4/2219843891/TB2T_nbepXXXXXgXXXXXXXXXXXX-2219843891.jpg\" style=\"border:0px;\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/2219843891/TB2UiC.epXXXXagXXXXXXXXXXXX-2219843891.jpg\" style=\"border:0px;\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i4/2219843891/TB2siK7epXXXXa.XXXXXXXXXXXX-2219843891.jpg\" style=\"border:0px;\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/2219843891/TB2ZyWRepXXXXawXpXXXXXXXXXX-2219843891.jpg\" style=\"border:0px;\" align=\"absmiddle\" />', 'images/201509/thumb_img/71_thumb_G_1441827471826.jpg', 'images/201509/goods_img/71_G_1441827471875.jpg', 'images/201509/source_img/71_G_1441827471024.jpg', '1', '', '1', '1', '0', '0', '1441825865', '100', '0', '1', '1', '1', '0', '0', '0', '1442515916', '0', '', '-1', '-1', '0', '', '5', '19.90', 'images/201509/1441825865656081345.jpg', '25', '1', '1', '1');
